import React, { Component } from 'react'
import { Fragment } from 'react/cjs/react.production.min';

export default class VehicleRadio extends Component {
  constructor(props) {
    super(props);
    this.vehicleID = 'vehicles-'+this.props.id
  }

  render() {
    return (
      <Fragment>
          <input type="radio" id={this.vehicleID} name={this.props.groupid} 
            value={this.props.vehicle.name} 
            />
          <label htmlFor={this.vehicleID}>{this.props.vehicle.name}
            <span data-vehicle-avail>({this.props.vehicle.total_no})</span>
          </label>
      </Fragment>
    )
  }
}
